//Styles
import "./styles.scss";

//JsPDF library
import { jsPDF } from "jspdf";

var zeit : number = 1000;

document.querySelector(".download_btn").addEventListener("click", () => {
    date();
    genPDF();
});

window.onload = async function () {
    let response = await fetch("/lastGameScore");
    let responseText = await response.text();
    zeit = Math.round(parseInt(responseText) / 1000);
};

function snal() {
    let inputElement: HTMLInputElement = document.getElementById(
        "name"
    ) as HTMLInputElement;
    var spielername = inputElement.value;
    return spielername;
}

function date() {
    const heute = new Date();
    const year = heute.getFullYear();
    const month = heute.getMonth() + 1;
    const day = heute.getDate();

    if (month < 10) {
        var datum = day + "." + "0" + month + "." + year;
    } else {
        var datum = day + "." + month + "." + year;
    }

    console.log(datum);

    return datum;
}
function time() {
    const heute = new Date();

    const min = heute.getMinutes();
    const hour = heute.getHours();

    if (min < 10) {
        var uhrzeit = hour + ":0" + min + "Uhr";
    } else {
        var uhrzeit = hour + ":" + min + " Uhr";
    }

    console.log(uhrzeit);

    return uhrzeit;
}

function feedbackline1() {
    var fail = "den Test leider nicht bestanden";
    var sucess = "den Test bestanden";
    if (zeit < 20000) {
        return fail;
    } else {
        return sucess;
    }
}

function feedbackline2() {
    var fail = "Nächstes Mal schaffst du es!";
    var sucess = "Glückwunsch";
    if (zeit < 20000) {
        return fail;
    } else {
        return sucess;
    }
}

function genPDF() {
    var logodata =
        "data:image/jpeg;base64,";
    var felsen_comp =
        "data:image/jpeg;base64,";

    var doc = new jsPDF();

    doc.addImage(logodata, "JPEG", 150, 15, 50, 17);
    doc.addImage(felsen_comp, "JPEG", 0, 185, 210, 120);
    doc.setFontSize(60);
    doc.setFont("helvetica", "normal");
    doc.text("Urkunde", 105, 50, null, "center");
    doc.setFontSize(30);
    doc.text("Felsen-Dominator", 105, 60, null, "center");

    doc.text(snal(), 105, 80, null, "center");

    doc.setFontSize(20);
    doc.text("hat am:", 105, 90, null, "center");

    doc.setFontSize(30);
    doc.text(date(), 105, 100, null, "center");

    doc.setFontSize(20);
    doc.text("um:", 105, 120, null, "center");

    doc.setFontSize(30);
    doc.text(time(), 105, 130, null, "center");

    doc.text(zeit.toString(), 105, 150, null, "center");

    doc.setFontSize(20);
    doc.text("Punkte erreicht und damit", 105, 160, null, "center");

    doc.setFontSize(20);
    doc.text(feedbackline1(), 105, 170, null, "center");
    doc.setFontSize(20);
    doc.text(feedbackline2(), 105, 180, null, "center");

    /*doc.text(20, 20, zeit);*/
    /*doc.fromHTML($('#urkunde').get(0), 0,0,{
				
				'width':500});*/
    doc.save("Urkunde-Felsen-Dominator.pdf");
}
